import React from 'react';
import { withRouter } from 'react-router-dom';

class SongCard extends React.Component{
  // state = {
  //
  // }
  render(){
    console.log("soncard props", this.props);
    return(
      <div>
        <h2>{this.props.track.name}</h2>
        <h3>{this.props.track.artistName}</h3>
        <p>{this.props.track.albumName}</p>
      </div>
    )
  }
}

export default withRouter(SongCard);
